            </h6>
             <h1 className="mx-auto mt-2 text-white max-w-xl bg-gradient-to-r from-codeOrange to-purple bg-clip-text text-3xl font-normal sm:max-w-2xl sm:text-5xl lg:max-w-3xl lg:text-7xl  ">
